export class StandingsTeam{
    constructor(public id:number, public conferenceStandingsPlace:number, public divisionStandingsPlace:number, public teamName:string, public wins:number, public losses:number, public ot:number, 
        public record:string, public points:number, public pointsPercentage:number){
        this.id = id;
        this.conferenceStandingsPlace = conferenceStandingsPlace;
        this.divisionStandingsPlace = divisionStandingsPlace;
        this.teamName = teamName;
        this.wins = wins;
        this.losses = losses;
        this.ot = ot;
        this.record = record;
        this.points = points;
        this.pointsPercentage = pointsPercentage;
    }
}
